  `secondvisit_living_situation` varchar(255) DEFAULT NULL COMMENT '居住情况(1独自居住  2 与配偶居住  3 与子女居住  4 其他 )',
  `secondvisit_medical` varchar(255) DEFAULT NULL COMMENT '医疗费用支付方式(1城镇职工基本医疗保险  2城镇居民基本医疗保险  3新型农村合作医疗  4贫困救助  5商业医疗保险  6全公费  7全自费  8其他)',
  `secondvisit_visit_object_categories` varchar(255) DEFAULT NULL COMMENT '走访对象类别(1低保  2低收入  3建档立卡贫困老人  4重点优抚对象)',
  `secondvisit_expectations_pension` varchar(255) DEFAULT NULL COMMENT '期望的养老模式(0居家养老   1社区养老   2机构养老   3其他)',
  `secondvisit_expectations_pension_server` varchar(255) DEFAULT NULL COMMENT '期望的养老服务(0家政服务 1生活照料 2健康咨询 3精神慰藉 4陪同就医 5换季服务 6助浴服务 7助残服务 8助洁服务 9助餐服务 10 助行服务 11定制服务)',
  `createtime` varchar(255) DEFAULT NULL,
  `createuserid` int(11) DEFAULT NULL,
  `deptid` int(11) DEFAULT NULL,
  `face_identify_top_id` int(11) DEFAULT NULL,
  `secondvisit_medical_other_text` varchar(255) DEFAULT NULL COMMENT '医疗支付方式其他对应文本',
  `secondvisit_expectations_pension_other_text` varchar(255) DEFAULT NULL COMMENT '期望的养老模式其他选择对应文本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='第二次走访基础信息表';

