  `num` int(11) DEFAULT NULL COMMENT '排序',
  `pid` int(11) DEFAULT NULL COMMENT '父部门id',
  `pids` varchar(255) DEFAULT NULL COMMENT '父级ids',
  `simplename` varchar(45) DEFAULT NULL COMMENT '简称',
  `fullname` varchar(255) DEFAULT NULL COMMENT '全称',
  `linkman` varchar(32) DEFAULT NULL COMMENT '联系人',
  `tel` varchar(20) DEFAULT NULL COMMENT 'tel',
  `email` varchar(100) DEFAULT NULL COMMENT 'email',
  `address` varchar(255) DEFAULT NULL,
  `provinceid` varchar(64) DEFAULT NULL COMMENT '省',
  `cityid` varchar(64) DEFAULT NULL COMMENT '市',
  `districtid` varchar(64) DEFAULT NULL COMMENT '县',
  `tips` varchar(255) DEFAULT NULL COMMENT '提示',
